import React from "react";
import './Header.css'


class Header extends React.Component {
    render() {
        return (

            <div className="header" >
                <div className="namediv">
            <span className="namespan">{this.props.Name}</span>
            </div>
            <div className="align-end">
                <button>About</button>
            </div>
            </div>
        )


    }

}
 export default Header
